var myScatterChart;
var suburb2 = [];
var type3 = [];
var type4 = [];


function callServer2(callback, statistics1, yearNum){
    var xmlhttp = new XMLHttpRequest();
    xmlhttp.onreadystatechange = function() {
        if (this.readyState == 4 && this.status == 200) {
            callback(this.responseText, statistics1, yearNum);
        };
    }
    xmlhttp.open("GET", "../static/JSON/new_submit.json", true);
    xmlhttp.send();
}

function extract_unemployment_data_scatter(responseText, statistics1, yearNum){
    suburb2 = []
    type3 = [];
    type4 = []
    var myArr = JSON.parse(responseText);
    var suburb_sentiments = average_sentiments[yearNum]
    var item;
    // console.log(statistics1);
    // console.log(statistics2);
    for (item in myArr){

        if (item in suburb_sentiments){
            suburb2.push(item);
            type3.push(myArr[item][statistics1]);
            type4.push(suburb_sentiments[item])
            // console.log(item);
        }

    }

    var my_data = generateData(type3, type4);
    var data = {
        datasets: [{
            label: statistics1,
            data: my_data,
            backgroundColor: "#ecc6c6",
            borderColor: "#ff0000",
            borderWidth: 1,
            // yAxisID: statistics1
        }]
    }

    showScatter(data);
}

function showScatter(data){
    if (myScatterChart){
        myScatterChart.destroy();
    }
    var chart = document.getElementById("scatterchart").getContext("2d");
    myScatterChart = new Chart(chart, {
        type: 'scatter',
        data: data,
        options: {
            tooltips: {
                callbacks: {
                    label: function(tooltipItem, data) {
                        var index = tooltipItem['index']

                        return suburb2[index];
                    }
                }
            }
        }
    });
}


function generateData(stats1, stats2){
    if (stats1.length == stats2.length){
        var data = [];
        for (var i=0; i < stats1.length; i++ ){
            data.push({
                x:stats1[i],
                y:stats2[i]
            })
        }
        return data;
    }
}

function changeStats(){
    var statistics1 = document.getElementById("Type3").value;
    var statistics2 = document.getElementById("year_select").value;
    callServer2(extract_unemployment_data_scatter, statistics1, statistics2);
}

callServer2(extract_unemployment_data_scatter,  "total_unemployed", "2014");